import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const NotFound = () => {
  const navigate = useNavigate();

  useEffect(() => {
    setTimeout(() => {
      navigate('/')
    }, 1000)
  }, [])
  return (<h2>404 Not Found</h2>);
};

export default NotFound;
